   // Set the token when the user logs in\n      userCredential.user.getIdToken().then((idToken) => {\n        this.token = idToken;\n        this.cookies.set(\"token\",this.token)\n      });\n      return userCredential;\n    });\n  }\n  loginWithGoogle() {\n    return signInWithPopup(this.auth, new GoogleAuthProvider()).then((userCredential) => {\n      // Set the token when the user logs in\n      userCredential.user.getIdToken().then((idToken) => {\n        this.token = idToken;\n        this.cookies.set(\"token\",this.token);\n      });\n      return userCredential;\n    });\n  }\n\n  loginWithGithub(){\n    return signInWithPopup(this.auth, new GithubAuthProvider()).then((userCredential) => {\n      // Set the token when the user logs in\n      userCredential.user.getIdToken().then((idToken) => {\n        this.token = idToken;\n        this.cookies.set(\"token\",this.token);\n      });\n      return userCredential;\n    });\n  }\n  logout() {\n    this.token=\"\";\n    this.cookies.set(\"token\",this.token)\n    return signOut(this.auth);\n  }\n\n  getToken() {\n    return this.cookies.get(\"token\")\n  }\n\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"coverage.html":{"url":"coverage.html","title":"coverage - coverage","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    Documentation coverage\n\n\n\n    \n\n\n\n    \n        \n            File\n            Type\n            Identifier\n            Statements\n        \n    \n    \n        \n            \n                \n                server.ts\n            \n            function\n            app\n            \n                0 %\n                (0/1)\n            \n        \n        \n            \n                \n                server.ts\n            \n            function\n            run\n            \n                0 %\n                (0/1)\n         